function Card({data ,deleteObject}){
    const space = {
        display:"flex",
        justifyContent:"space-between",
        margin:"10px"
    }
   
    return <div style={space}>
        <h3>{data.name}</h3>
        <button type="button" className="btn-close" aria-label="Close" onClick={()=>deleteObject(data.name)}></button>
    </div>
}
export default Card
